import React from "react";
import { VectorMap } from "react-jvectormap";

class map extends React.Component {
    render() {
        return (
            <VectorMap map={'ca_lcc'}
                  map={"in_mill"}
                  backgroundColor="white"
                  focusOn={{
                    x: 0.5,
                    y: 0.5,
                    scale: 0,
                    animate: false
                  }}
                  zoomOnScroll={true}
                  containerStyle={{
                  width: "100%",
                  height: "700px"
                  }}
                  onRegionClick={this.handleClick} //gets the country code
                  onRegionTipShow={this.handleshow2}
                  containerClassName="map"
                  regionStyle={{
                    initial: {
                       fill: "#e4e4e4",
                       "fill-opacity": 0.9,
                       stroke: "none",
                       "stroke-width": 0,
                       "stroke-opacity": 0
                    },
                    hover: {
                       "fill-opacity": 0.8,
                       cursor: "pointer",
                       fill: 'blue'
                    },
                    selected: {
                        fill: 'white'
                      },
                  }}

                  regionsSelectable={false}
                  series={{
                     regions: [
                         {
                          values: this.getalldata(), //can be directly served //with api response or any data
                          scale: ['#F8E4E2', '#FC3409'], //color range
                          normalizeFunction: "polynomial"
                         }
                     ]
                  }}
            />
        )
    }
}
export default map;
